const configItem = $('Workflow Configuration').first();
const targetName = configItem ? configItem.json.targetDeviceName : '2F';

const items = $input.all();

let targetDevice = null;
let targetId = null;

if (items.length > 0 && items[0] && items[0].json) {
  const data = items[0].json;
  if (data.devices && Array.isArray(data.devices)) {
    targetDevice = data.devices.find(d => d.name === targetName);
  } 
  else if (Array.isArray(data)) {
    targetDevice = data.find(d => d.name === targetName);
  }
}

if (targetDevice) {
  targetId = targetDevice.id;
}

return [{
  json: {
    target_device_id: targetId,
    device_found: !!targetDevice,
    target_name: targetName
  }
}];

const items = $input.all();
if (items.length === 0) return [];

const randomIndex = Math.floor(Math.random() * items.length);
const track = items[randomIndex].json;

return {
  json: {
    track_uri: track.uri,
    track_name: track.name,
    artist_name: track.artists[0].name,
    album_image: track.album.images[0].url,
    device_id: $('Find Target Device').first().json.target_device_id
  }
};
